const Todos = ()=>{

const [Todos,setTodos] = useState();





	useEffect(()=>{


		axios.get("https://jsonplaceholder.typicode.com/todos").then((res)=>{

			const responseTodos=res.data;
			setTodos(responseTodos);



		});







	},[]);

return(

	<React.Fragment>



	{
	                                                                         	(Todos) ?<CircularProgress/>: <h1> </h1>







	}

	        </React.Fragment>





);


}

export default Todos;
